mapper.select:

select 

from FCALLBANK
where FCALLBANK_CURRENCY = #{fcallbankCurrency,jdbcType=CHAR}
  and FCALLBANK_BKNO = #{fcallbankBkno,jdbcType=CHAR}
  and FCALLBANK_BRNO = #{fcallbankBrno,jdbcType=CHAR}

mapper.delete:

delete from FCALLBANK
where FCALLBANK_CURRENCY = #{fcallbankCurrency,jdbcType=CHAR}
  and FCALLBANK_BKNO = #{fcallbankBkno,jdbcType=CHAR}
  and FCALLBANK_BRNO = #{fcallbankBrno,jdbcType=CHAR}
